import React, { useState } from 'react';
import tradeImage from './oo.jpg'; // Ensure the path is correct

function Signup({ onSignup }) {
    const [username, setUsername] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        // Store user credentials (in a real app, you'd want to store this securely)
        localStorage.setItem('user', JSON.stringify({ username, password }));
        onSignup(); // Call this on successful signup
    };

    return (
        <div
            style={{
                minHeight: '100vh',
                backgroundImage: `url(${tradeImage})`,
                backgroundSize: 'cover',
                backgroundPosition: 'center',
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
                padding: '20px',
                color: '#333',
            }}
        >
            <div
                style={{
                    backgroundColor: 'rgba(255, 255, 255, 0.9)',
                    padding: '40px',
                    borderRadius: '15px',
                    width: '100%',
                    maxWidth: '450px',
                    boxShadow: '0 4px 20px rgba(0,0,0,0.3)',
                    backdropFilter: 'blur(10px)',
                }}
            >
                <h3 className="mb-4 text-center" style={{ fontWeight: 'bold', color: '#007bff' }}>Signup on TradGoo</h3>
                <form onSubmit={handleSubmit} className="needs-validation" noValidate>
                    <div className="mb-3">
                        <label htmlFor="username" className="form-label">Username</label>
                        <div className="input-group">
                            <span className="input-group-text"><i className="fas fa-user"></i></span>
                            <input
                                name="username"
                                id="username"
                                type="text"
                                className="form-control"
                                required
                                value={username}
                                onChange={(e) => setUsername(e.target.value)}
                            />
                        </div>
                        <div className="valid-feedback">Looks Good!</div>
                    </div>
                    <div className="mb-3">
                        <label htmlFor="email" className="form-label">Email</label>
                        <div className="input-group">
                            <span className="input-group-text"><i className="fas fa-envelope"></i></span>
                            <input
                                name="email"
                                id="email"
                                type="email"
                                className="form-control"
                                required
                                value={email}
                                onChange={(e) => setEmail(e.target.value)}
                            />
                        </div>
                    </div>
                    <div className="mb-3">
                        <label htmlFor="password" className="form-label">Password</label>
                        <div className="input-group">
                            <span className="input-group-text"><i className="fas fa-lock"></i></span>
                            <input
                                name="password"
                                id="password"
                                type="password"
                                className="form-control"
                                required
                                value={password}
                                onChange={(e) => setPassword(e.target.value)}
                            />
                        </div>
                    </div>
                    <button className="btn btn-primary w-100" style={{ transition: 'background-color 0.3s' }} onMouseOver={(e) => e.currentTarget.style.backgroundColor = '#0056b3'} onMouseOut={(e) => e.currentTarget.style.backgroundColor = '#007bff'}>
                        Signup
                    </button>
                </form>
            </div>
        </div>
    );
}

export default Signup;
